import React from 'react';
import logo from './logo.svg';
import './App.css';
import './pages/ProjectCountPage';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
